import { NavLink } from 'react-router-dom';
import './../Dialogs.css';

const DialogItem = (props) => {
	let path = '/dialogs/' + props.id;
	return (
		<div className='dialog'>
			<NavLink to={path}>{props.name}</NavLink>
		</div>
	)
}

export default DialogItem;
